import React from 'react';
import { Link } from 'react-router-dom';

function navigationBar() {
    return (
        <nav style={styles.navigationBar}>
            <ul style={styles.navigationList}>
                <li style={styles.navigationItem}>
                    <Link to="/" style={styles.navigationLink}>Home</Link>
                </li>
                <li style={styles.navigationItem}>
                    <Link to="/library" style={styles.navigationLink}>Library</Link>
                </li>
                <li style={styles.navigationItem}>
                    <Link to="/recommendations" style={styles.navigationLink}>Recommendations</Link>
                </li>
            </ul>
        </nav>
    );
}

const styles = {
    navigationBar: {
        backgroundColor: '#333',
        padding: '10px 20px',
        textAlign: 'center',
    },
    navigationList: {
        listStyle: 'none',
        margin: 0,
        padding: 0,
        display: 'flex',
        justifyContent: 'center',
    },
    navigationItem: {
        margin: '0 15px',
    },
    navigationLink: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '18px',
    },
};

export default navigationBar;
